import Metronome from "../Metronome/Metronome";
import SearchBar from "../SearchBar/SearchBar";
import VideoPlayer from "../VideoPlayer/VideoPlayer";

const App = () => {

    return (
        <div>
            <h1>Beat Visualizer</h1>
            <div>
                <SearchBar />
                <VideoPlayer />
                <Metronome />
                <PlayButton />
            </div>
        </div>
    );
}

export default App;
